('535e3063-0550-4822-9741-1515e386fb56', 1, '(Sample) Thermistor', 'Thermistors are thermally sensitive resistors whose prime function is to exhibit a large, predictable and precise change in electrical resistance when subjected to a corresponding change in body temperature. Negative Temperature Coefficient (NTC) thermistors exhibit a decrease in electrical resistance when subjected to an increase in body temperature and Positive Temperature Coefficient (PTC) thermistors exhibit an increase in electrical resistance when subjected to an increase in body temperature.', 1, 1, 0, NULL, 0, '535e1ed8-62ac-4b17-a1b2-1613e386fb56', '523a0abb-21e0-4b44-a219-6142c6c32681', '535e2638-9a18-4f30-bd0f-1acae386fb56', NOW(), '535e2638-9a18-4f30-bd0f-1acae386fb56', NULL, NULL, NOW(), '5297b2e7-3a14-45c2-b2dc-2d8f0a000005', '0', '535e14e7-22c4-4672-b9b7-1516e386fb56'),
